INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (2305,131,1,'FUNCTION SWITCHES','<table style="width: 100%;" border="0" cellspacing="0" cellpadding="0"><colgroup> <col width="50%" /> <col width="50%" /> </colgroup> <tbody>  <tr bgcolor="#fff"> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px; border-right-width: 2px; border-right-style: solid; border-right-color: #999999;" align="center" height="20">COUPLE</td> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px;" align="center">Linking CH1 ( master ) and CH2; stereo operation</td> </tr><tr> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px; border-right-width: 2px; border-right-style: solid; border-right-color: #999999;" align="center" bgcolor="#CCCCCC" height="20">OPERATING LEVEL</td> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px;" align="center" bgcolor="#CCCCCC">Internal reference level: from +4dBu to -10dBV</td> </tr><tr bgcolor="#fff"> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px; border-right-width: 2px; border-right-style: solid; border-right-color: #999999;" align="center" height="20">BYPASS</td> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px;" align="center">Bypass switch</td> </tr><tr> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px; border-right-width: 2px; border-right-style: solid; border-right-color: #999999;" align="center" bgcolor="#CCCCCC" height="20">I/O METER</td> <td style="border-bottom-width: 2px; border-bottom-style: solid; border-bottom-color: #999999; height: 20px;" align="center" bgcolor="#CCCCCC">Switches input and output for