INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102299,131,2,'SALIDA DE AUDIO ','Tipo: XLR y 1/4 "Jack in Impedancia: Equilibrado: 60 Ohm - Desequilibrado: 30Ohm <br> Nivel máximo de salida: +21 dBu <br> Ancho de banda: 20 Hz a 20 KHz a + 0, -0.5dB <br> THD + N%: 0,01% typ.1KHz, @ + 4dBu <br> 0,04% typ, 1KHz, @ +20 dBu <br> IMD: 0,01% typ <br> ruido:> -90dBu <br> Crosstalk: <-100 dB ',30,1)
