INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102302,131,2,'Expansor / puerta SECCIÓN ','Tipo: control de la relación inteligente Expander <br> Umbral: Variable: de OFF a + 15 dB <br> victorias: Variable: de 1: 1,2 a 1: 8 ',60,1)
INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102303,131,2,'COMPRESOR SECCIÓN ','Tipo: compresor de control de la rodilla inteligente <br> Umbral: Variable: de -40 dB a + 20 dB <br> victorias: Variable: de 1: 1 a 8: 1 <br> Manual Tiempo de Ataque: Variable: de 1 ms a 150 ms <br> Manual Tiempo de liberación: variable: de 0,05 ms a 5s <br> Tiempo de Ataque Auto: Typ. 15 ms a 10 dB; 5ms a 20 dB; 3ms en 30dB <br> Auto Release: Typ. 125 dB / s <br> salida: Variable; -20dB A +20 dB ',70,1)
INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102304,131,2,'Limitador de picos SECCIÓN ','Tipo: Smart Control de ganancia limitador de pico <br> Umbral: Variable: de 0 a OFF <br> victorias: 8: 1 <br> Etapa 1 :: Clipper <br> Attack y Release: cero <br> Etapa 2: Programa Limitador <br> Ataque: tip. <5 ms <br> Publicación: tip. 20dB / s ',80,1)
INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102305,131,2,'interruptores de función ','PAREJA: Vinculación de CH1 (maestro) y CH2; operación estéreo<br>NIVEL OPERATIVO: nivel de referencia interno: de +4dBu a -10dBV<br>BYPASS: Interruptor Bypass<br>I/O METER: interruptores de entrada y salida para el medidor de nivel<br>AUTO: Permite que el programa depende ajuste de los tiempos de ataque y relajación<br>SC eXTERNA: Cambia la sección de detector a la entrada externa<br>SC MONITOR: Seguimiento de la entrada SC externa, desenganchar el audio normal<br>iNTELIGENTE: Permite que el control rodilla inteligente características<br>SC FILTER: permite la detección depende de la frecuencia',90,1)
INSERT INTO dbo.Attribute (AttributeId, ProductId, CultureId, Name, Value, Priority, Enabled) values (102306,131,2,'INDICADORES ','REDUCCION DE GANANCIA: 12 elemento LED <br> ENTRADA / SALIDA DE NIVEL: 8 LED <br> elemento expansor / puerta UMBRAL: 2 elementos LED (en "+" arriba "-") <br> COMPRESOR UMBRAL: 3 elementos LED (bajo "+ "inteligente" 0 "por encima de" - ") <br> limitador de pico UMBRAL: 1 elemento LED (función limitador) <br> interruptor Función: indicador LED para cada ',100,1)
